import React from 'react'

const Assignment = () => {
    return (
        <div>
            <img className="assignment-pic" src="https://res-1.cdn.office.net/eduassignmentsui/assets/6pu4deme.backend-provisioning.svg"></img>
            <h2>You need a class to start using assignments!</h2>
            <a href="/">Teachers: start here.</a>
            <p>Students: ask your teacher to create the class for you.</p>
        </div>
    )
}

export default Assignment
